import {  useDispatch, useSelector} from "react-redux";
import { useEffect } from "react";
import {getAllRace} from '../../Redux/actions';
import Card from './Card/card';
import Searchbar from '../../components/searchbar/searchbar';
// import BarraArriba from '../../components/barraArriba/barraArriba';



export default function Home() {

const state = useSelector((state) => state.breed);
const dispatch = useDispatch();

useEffect (()=> {                   //me trae todas las razas
  dispatch (getAllRace())
}, [dispatch]) 






return (
    <div>
       <div>  

        <Searchbar/>
{state.map((c)=>(
  <Card  image={c?.image} name={c?.name} temperament={c?.temperament} weight={c?.weight} /> 
))}
        </div>
      <h1 className="title">Universe of Dogs</h1>
      {/* <img src={imagenFondo} alt="Universe of Dog" className='imagefondo' />   */}
      {/* <button className="btn-search">Buscar Perros</button> */}
    </div>
  );
}
